import { useAuth } from './auth'
import { useNavigate } from 'react-router-dom'
function Logout() {
    const navigate = useNavigate()
    const auth = useAuth()
    const handleLogout = () => {
        auth.logout()
        navigate('/')
    }
    return (
        <div className='logout'>
            <p>Do you </p>Welcome {auth.user}.<button onClick={handleLogout}>Logout</button>
        </div>
    )
}
export default Logout
